import Courses from "../Home/Courses";
function Home(props) {
  let uri = "Pyth"
  function Valid(v){
    return v.courses.title.indexOf(uri) > -1
  }
  
  let data_python = Array.from(props.python_courses_data).filter(function(v){Valid(v)});
  let aws_data = Array.from(props.python_courses_data).filter(function(v){Valid(v)});
  let data_science_data =  Array.from(props.python_courses_data).filter(function(v){Valid(v)});
  let draw_data = Array.from(props.python_courses_data).filter(function(v){Valid(v)});
  let excel_data =  Array.from(props.python_courses_data).filter(function(v){Valid(v)});
  let web_data =  Array.from(props.python_courses_data).filter(function(v){Valid(v)});
  return (
    <Courses
      data_python={data_python}
      aws_data={aws_data}
      data_science_data={data_science_data}
      draw_data={draw_data}
      excel_data={excel_data}
      web_data={web_data}
    />
  );
}

export default Home;
